(4, 'https://www.finstreet.in/Event_detail?eventName=4&ref=', 'social-links/4.zip', 'Finstreet is excited to announce its Golden Package to you.\r\nSave your seats to  Finstocks, Cryptonext and Cryptonite at an unbelievable discount of 86% &url=https://www.finstreet.in/Event_detail?eventName=4&ref=', 'https://www.finstreet.in/Event_detail?eventName=4&ref=', 'After launching the First event successfully in Top *IITs & IIMs*,\r\n\r\nFinStreet is Indias Most Trusted Financial Coaching, Now we are excited to announce its *Golden Package* to you.\r\nSave your seats to  *Finstocks and Cryptonext* at an unbelievable discount of *86%*. \r\n\r\n*Finstocks, powered by 5Paisa*:\r\nAn Online workshop that will teach you all about the stock market through practical demonstrations.\r\n\r\n*Cryptonext, powered by WazirX* :\r\nLearn the latest strategies to win in the cryptocurrency market. \r\n\r\nOther deliverables along with the course :-\r\n\r\n*E-Certificate* (easily sharable) for each individual\r\n\r\n*Free ebooks*\r\n\r\n*Live Q&A & Doubt sessions*\r\n\r\nThese events will be guided by *Mr Bandhul Bansal* a financial coach with an experience of six years in the field of finance\r\n\r\nVisit our website today to avail a *discount of 86% on the enrollment fee Now* \r\n\r\nFor *Golden Package* Register here\r\n\r\nhttps://www.finstreet.in/Event_detail?eventName=4&ref=', 'Kickstart your Investment career at an 86&#37; Discount', 'Hello from Finstreet, India most trusted financial Coach\r\n\r\nThe stock market has always had an allure that not many can avoid. \r\nIt is one of the more traditional and popular avenues to make profitable investments that will surely set you for life.\r\nHowever, it is also not an easy feat to learn―\r\nIt takes time, patience and most importantly, experience.\r\n\r\nKeeping this in mind, we have curated three exclusive events, just for you:\r\nFinstocks,\r\nCryptonext, &\r\nCryptonite\r\n\r\nFinstocks, powered by 5 paisa, is a workshop that will teach you all you need to know about the functioning of the market.\r\n\r\nCryptonext, powered by WazirX, . If you are about ready to earn an exponential return on your investment, then this is the place for you to be.\r\n\r\nCryptonite, powered by WazirX, is all about successfully investing in cryptocurrencies. \r\n\r\nThese events will be guided by our finance guru, Mr Bandhul Bansal an entrepreneur-turned-financial coach with an experience of six years in the financial market\r\n\r\nAnd now to the exciting part:\r\nI present to you The Golden Package.\r\n\r\nThrough this exclusive deal, you will be able to save your seats to all three events at a discount of 86%\r\n. \r\nVisit our website today to avail this opportunity.\r\n\r\nhttps://www.finstreet.in/Event_detail?eventName=4&ref=\r\n', 4);
